import React from 'react';
import Link from 'next/link';

class Index extends React.Component {
    // constructor
    constructor(props) {
        super(props);
    }

    // render display
    render () {
        return (
            <div className="container">
                <div className="navbar">
                    <Link href="/search">
                        <a>SEARCH</a>
                    </Link>
                    <Link href="/about">
                        <a>ABOUT</a>
                    </Link>
                    <Link href="/">
                        <a>HOME</a>
                    </Link>
                </div>
                <div className="content">
                    <h1>CAMPA'ROUND</h1>
                    <p>A solution for all your campground needs!</p>
                </div>

            <style jsx>{`
                .container {
                    font-family: Roboto;
                    margin: 0;
                }

                .navbar {
                    float: right;
                    padding: 10px 30px 0 0;
                    width: 100%;
                    margin-bottom: 250px;
                }

                a {
                    float: right;
                    padding-left: 36px;
                    text-decoration: none;
                    color: black;
                }

                .content {
                    text-align: center;
                }

                h1 {
                    margin: 0 auto;
                    font-size: 2.6em;
                }
            `}</style>
            </div>
        );
    }
}

export default Index;
